const Page = ({ numRows }) => {
  const numPages = Math.ceil(numRows.length / 10)
  const pageArr = new Array(numPages)
  console.log(pageArr)
  const pageLinks = pageArr.map((num, idx) => {
    return idx
  })
  console.log(pageLinks)
  return (
    <p>{numPages > 1 ? pageLinks : null}</p>
  )
}

const Link = ({ number }) => {
  return (
    <a onClick={(e) => e.preventDefault}>{number}</a>
  )
}

export default Page
